import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebook, faTwitter, faInstagram } from '@fortawesome/free-brands-svg-icons';
import { Link } from 'react-router-dom';  // Import Link from react-router-dom

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">CROWNPRINCE PROPERTIES</div>
      <ul className="nav-links">
        <li><Link to="/">Home</Link></li>  {/* Updated to use Link for navigation */}
        <li><Link to="/about">About</Link></li>
        <li><Link to="/projects">Projects</Link></li>
        <li><Link to="/team">Team</Link></li>  {/* Added Team link */}
        <li><Link to="/blog">Blog</Link></li>  {/* Blog page route */}
        <li><Link to="/contact">Contact</Link></li>
        <li><Link to="/services">Services</Link></li>
      </ul>
      <div className="navbar-right">
        <span className="contact-info">+234 912 500 0558</span>
        <div className="social-icons">
          <a href="#facebook">
            <FontAwesomeIcon icon={faFacebook} /> {/* Facebook icon */}
          </a>
          <a href="#twitter">
            <FontAwesomeIcon icon={faTwitter} /> {/* Twitter icon */}
          </a>
          <a href="#instagram">
            <FontAwesomeIcon icon={faInstagram} /> {/* Instagram icon */}
          </a>
        </div>
        <button className="cta-btn">Register</button>
      </div>
    </nav>
  );
};

export default Navbar;
